pragma solidity ^0.4.22;
contract Token {
             address issuer;
             mapping (address => uint) balances;
             struct Userstruct{
                 mapping (uint => address)useraddress;
                 mapping (uint => uint) moneyamount;
                 mapping (uint => string) bingqing;
             } 
             mapping (address => uint) balances0;
             mapping (address => uint) balances1;
             mapping (address => Userstruct)userstruct;
             event Issue(address account, uint amount);
             event Transfer(address from, address to,uint amount);
             function Token() {
                 issuer = msg.sender;
             }

             function issue(address account, uint amount) {
                 if (msg.sender != issuer) throw;
                 balances[account] += amount;
             }
             function init(address account) returns(uint){
                 balances[account]=1000000;
                 balances0[0x889c82047363e1a05b05d004b57a860ec1c31d81]=1000000;
                 return balances[account];
             }
             function chaxun(address account) constant public returns(string a,uint b){
                  a="未报销钱数：";
                  b=1000000-balances[account]-balances0[account];
             }
             function transfer01(address account,uint amount,string aa)  returns(string a)
             {
                 uint i=balances1[account];
                 balances[account] -= amount;
                 balances[0x889c82047363e1a05b05d004b57a860ec1c31d81] += amount;
                 userstruct[account].useraddress[i]=account;
                 userstruct[account].moneyamount[i]=amount;
                 userstruct[account].bingqing[i]=aa;
                 balances1[account]=i+1;
                 a="就诊成功！";
             }
             function getmessage(address account,uint ine) constant public returns(string d ,uint a,string f ,string b)
             {
                 d="就诊金额为 :";
                 a=userstruct[account].moneyamount[ine];
                 f="病情描述：";
                 b=userstruct[account].bingqing[ine];
             }
             function transfer02(address to, uint amount)  {
                if(balances0[0x889c82047363e1a05b05d004b57a860ec1c31d81]<amount){
                    print(amount,0);
                }
                balances0[to]+=amount;
                balances0[0x889c82047363e1a05b05d004b57a860ec1c31d81]-=amount;
                print(amount,1);
             }
             function print(uint amount,uint t) constant public returns(string a,uint b)
             {
                 if(t==0)
                 {
                    b=0;
                    a="保险报销未知错误";
                 }
                 else 
                 {
                     a="报销成功，报销金额：";
                     b=amount;
                 }
             }
             function getBalance(address account)constant returns (uint) {
                 return balances[account];
             }
             function getBalance0(address account)constant returns (uint) {
                 return balances0[account];
             }
              function getBalance1(address account)constant returns (uint) {
                 return balances1[account];
             }
         }
